- input: "TEXT\x1CC00099267\x1CTEXT-00001\x1C\x1CF3XA\x1CThis amendment reflects changes
    to schedule D on our June monthly report amended August 15, 2011.  This report
    discloses a number of entries crediting old, stale and uncleared items the committee
    had been carrying in its account registers.  The committee spent considerable
    time researching these items and has determined that the amounts were invoiced
    in error, voided, duplicate entries, or returned payments and are not owed amounts.
    \ Each credit has a text note referencing the reporting of the original payment
    and the reason for the credit. This report includes Memo Schedule A entries for
    contributions from the DNC State Party Victory Fund and Dollars for Democrats
    \ which are joint fundraising programs. The committee may not have received its
    share of the proceeds as of the end of the reporting period. The committee expects
    to receive transfers at some point following this reporting period. The Committee
    disclosed payments for Salaries/Wages for this period on Schedule H4 for Line
    21a, and Schedule B for Line 30b.  The Committee pays its employees with 100%
    federal funds, and disclosed the expenditures on Line 30b when the individual
    spends more than 25% of their compensated time in a given month on Federal election
    activity or activities in connection with a Federal election.  Those individuals
    who spend more than 0% but less than 25%  of their compensated time in a given
    month on Federal election activity or activities in connection with a Federal
    election are paid with Federal funds, and allocated on Schedule H4.  In either
    case, all amounts spent for employee specific 'fringe benefits,' consisting of
    health insurance and payroll taxes are paid for, and reported on a proportional
    basis equal to the amount associated with the individual that received the compensation
    and the funds with which the individual was paid.  Any reimbursements/allocation
    transfers to the Committee's federal account from the Committee's non-federal
    account for salaries, and/or benefits are associated with individuals whose activities
    do not exceed 25% in a given month.\n"
  record: fec.version.v7_0.TEXT
  result:
